import React from 'react'

export const LoginSignup = () => {
  return (
    <div className="main">

      
        <div style={styles.container}> 
            <div className='box2' style={styles.box}>
                <div className="text" style={{color:"grey"}}>Login</div>
                <label htmlFor="email" className="email" style={styles.label}>Email</label>
                <input type="email" className="emailip" style={styles.input} placeholder='Email' />
                <label htmlFor="password" className="password" style={styles.label}>Password</label>
                <input type="password" className="password" style={styles.input} placeholder='Password'/>
                <button className="login" style={styles.submit}>Log In</button>
            </div>
        </div>
        
      </div>
    
  )
}

const styles = {
    label:{
        height:"0px"

    },
    box:{
        width:'48vh',
        height:'25vh',
        backgroundsize:'cover',
        backgroundColor:"lightgreen",
        boxsizing: "border-box",
        justifyContent:"center",
        display:"grid",
        padding:"70px"
        
    },
    container:{
        minHeight: "48vh",
        display:"flex",
        justifyContent:"center",
        alignItems:"center",
        backgroundsize:"cover",
        backgroundColor:"teal",
        color: "white",
        
        
    },
    submit:{
        backgroundColor:"skyblue",
        color:"white",
        border:"none",
        // width:"10vh",
        margin:"auto",
        padding:"5px"
        


    },
    input:{
        height:"20px",
        border:"none",
    }

}

export default LoginSignup
